// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

contract DodoCoin {
    // State variables
    string public name = "DodoCoin";
    string public symbol = "DODO";
    uint8 public decimals = 18; // Standard decimals for ERC-20
    uint256 private _totalSupply;

    // Mapping to store balances and allowances
    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;

    // Events
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);

    // Constructor
    constructor(uint256 initialSupply) {
        _balances[msg.sender] = initialSupply * (10 ** decimals);
        _totalSupply = initialSupply * (10 ** decimals);
        emit Transfer(address(0), msg.sender, _totalSupply);
    }

    // Mandatory Functions

    // 1. totalSupply: Returns the total token supply.
    function totalSupply() public view returns (uint256) {
        return _totalSupply;
    }

    // 2. balanceOf: Provides the account balance of a specific address.
    function balanceOf(address account) public view returns (uint256) {
        return _balances[account];
    }

    // 3. transfer: Transfers tokens to a specified address.
    function transfer(address to, uint256 value) public returns (bool) {
        require(to != address(0), "ERC20: transfer to the zero address");
        require(_balances[msg.sender] >= value, "ERC20: transfer amount exceeds balance");

        _balances[msg.sender] -= value;
        _balances[to] += value;
        emit Transfer(msg.sender, to, value);
        return true;
    }

    // 4. transferFrom: Transfers tokens from one address to another.
    function transferFrom(address from, address to, uint256 value) public returns (bool) {
        require(to != address(0), "ERC20: transfer to the zero address");
        require(_balances[from] >= value, "ERC20: transfer amount exceeds balance");
        require(_allowances[from][msg.sender] >= value, "ERC20: transfer amount exceeds allowance");

        _balances[from] -= value;
        _balances[to] += value;
        _allowances[from][msg.sender] -= value;
        emit Transfer(from, to, value);
        return true;
    }

    // 5. approve: Allows a spender to withdraw from your account multiple times, up to the _value amount.
    function approve(address spender, uint256 value) public returns (bool) {
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[msg.sender][spender] = value;
        emit Approval(msg.sender, spender, value);
        return true;
    }

    // 6. allowance: Returns the remaining number of tokens that a spender is allowed to spend.
    function allowance(address owner, address spender) public view returns (uint256) {
        return _allowances[owner][spender];
    }

    // Additional Functions

    // Mint: Allows the contract owner to mint new tokens.
    function mint(address account, uint256 amount) public {
        require(account != address(0), "ERC20: mint to the zero address");

        _totalSupply += amount;
        _balances[account] += amount;
        emit Transfer(address(0), account, amount);
    }

    // Burn: Allows token holders to destroy tokens.
    function burn(uint256 amount) public {
        require(_balances[msg.sender] >= amount, "ERC20: burn amount exceeds balance");

        _balances[msg.sender] -= amount;
        _totalSupply -= amount;
        emit Transfer(msg.sender, address(0), amount);
    }
}
